import React from 'react';
import Routes from './routes'
import { BrowserRouter as Router } from 'react-router-dom';
import Nav from './pages/nav'
import './styles.css'
function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <Routes className='appp' />
      </div>
    </Router>
  );
}

export default App;
